import "../App.css";
import { Collapse, Divider, List, Input, Checkbox } from "antd";
import React, { Component } from "react";
import importJSON from "../data/questionsDict.json";
console.log(importJSON);
const Fb = importJSON.fb;
const { Panel } = Collapse;
const text = `
  A dog is a type of domesticated animal.
  Known for its loyalty and faithfulness,
  it can be found as a welcome guest in many households across the world.
`;
const subcategories = Fb.map((cat, catIndex) =>
  cat.subcategories.map((subCat, subCatIndex) => subCat.name)
);

class Checklist extends Component {
  render() {
    return (
      <div className="panels">
        {Fb.map((cat, catIndex) => {
          return (
            <Collapse defaultActiveKey={["1"]}>
              <Panel
                header={<div catIndex={catIndex}>{cat.name}</div>}
                key={catIndex + 1}
                className="bg-orange text-white"
              >
                <div catIndex={catIndex}>
                  {cat.subcategories.map((subCat, subCatIndex) => {
                    return <div subCatIndex={subCatIndex}>{subCat.name}</div>;
                  })}
                </div>
              </Panel>
            </Collapse>
          );
        })}
      </div>
    );
  }
}

export default Checklist;
